import React, { useEffect, useState } from "react";
import "../../styles/flowTwo/ZipCodePage.css";
import Header from "../UserFlowOne/Header.js";
import { useNavigate, useLocation } from "react-router-dom";

const ZipCodePage2 = () => {
  const navigate = useNavigate();
  const location = useLocation(); // Hook to access the current URL
  const { formData, setFormData } = useContext(FormDataContext);
  const [zipCode, setZipCode] = useState(formData.zipCode || "");
  const [errorMessage, setErrorMessage] = useState("");
  const [isGoogleTraffic, setIsGoogleTraffic] = useState(false);

  useEffect(() => {
    // Extract campaign parameters from URL or use localStorage
    const params = new URLSearchParams(location.search);
    const campaignName =
      params.get("campaign_name") ||
      localStorage.getItem("campaign_name") ||
      "default_campaign";
    const campaignId =
      params.get("campaign_id") ||
      localStorage.getItem("campaign_id") ||
      "default_id";
    const clickId =
      params.get("click_id") ||
      localStorage.getItem("click_id") ||
      "default_click";

    // Store these parameters in localStorage to persist data
    if (campaignName) {
      localStorage.setItem("campaign_name", campaignName);
    }
    if (campaignId) {
      localStorage.setItem("campaign_id", campaignId);
    }
    if (clickId) {
      localStorage.setItem("click_id", clickId);
    }

    // Check if the source is Google
    const dsp_name = params.get("dsp_name");
    if (dsp_name && dsp_name.toLowerCase() === "google") {
      setIsGoogleTraffic(true);
      localStorage.setItem("dsp_name", "google");
    } else {
      // Meta Pixel Code Initialization (only if not Google traffic)
      !(function (f, b, e, v, n, t, s) {
        if (f.fbq) return;
        n = f.fbq = function () {
          n.callMethod
            ? n.callMethod.apply(n, arguments)
            : n.queue.push(arguments);
        };
        if (!f._fbq) f._fbq = n;
        n.push = n;
        n.loaded = !0;
        n.version = "2.0";
        n.queue = [];
        t = b.createElement(e);
        t.async = !0;
        t.src = v;
        s = b.getElementsByTagName(e)[0];
        s.parentNode.insertBefore(t, s);
      })(
        window,
        document,
        "script",
        "https://connect.facebook.net/en_US/fbevents.js"
      );

      // Initialize the Pixel with your Pixel ID
      fbq("init", "1102235601240222");

      // Track page view when the component loads
      fbq("track", "PageView");
    }
  }, [location]);

  const handleSubmit = (e) => {
    e.preventDefault();

    // Check if zip code is valid
    const zipCodeRegex = /^\d{5}$/; // Only allows 5 digits (basic US zip code format)
    if (!zipCodeRegex.test(zipCode)) {
      setErrorMessage("Please enter a valid 5-digit zip code");
      return;
    }

    setErrorMessage("");

    // Track conversion event when the user submits the form (ad click event)
    if (!isGoogleTraffic) {
      fbq("track", "Lead", { value: 1.0, currency: "USD" });
    }

    // Add the green-active effect to the button
    const submitButton = e.target.querySelector(".get-started-button");
    submitButton.classList.add("green-active");

    // Store the zip code in the form data context and local storage
    setFormData({ ...formData, zipCode });
    localStorage.setItem("zip_code", zipCode);

    // Delay the navigation to show the green effect
    setTimeout(() => {
      // Navigate to the landerOffers page in the current tab
      navigate("/step-one2");
    }, 500); // Delay for a noticeable effect
  };

  return (
    <div>
      <Header />
      <div className="title">
        <h1>Find the lowest car insurance rates in {location}!</h1>
      </div>
      {/* Hero Section */}
      <div className="hero-section">
        <div className="form-container">
          <label htmlFor="zipCode">What is your ZIP Code?</label>
          <input
            className="form-container"
            type="text"
            id="zipCode"
            placeholder="ZIP Code"
            value={zipCode}
            onChange={handleInputChange}
          />
          <button onClick={handleSubmit}>Start Now</button>
          {error && <p className="error-message">{error}</p>}
        </div>
      </div>

      {/* Partners Section */}
      <div className="partners">
        <h4>OUR PARTNERS</h4>
        <div className="partner-logos">
          {/* Logo Section */}
          <img
            src="https://www.allstate.com/dist/content-client-react-app/static/media/logo-large.dd47a938943f3af25de5f6885d2c39d8.svg"
            alt="Allstate Logo"
            className="logo"
          />
          <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRBdupRpyPnMb5l6Mi3Mhoz8pT0cYVck-bh6Q&s"
            alt="The General Logo"
            className="logo"
          />
          <img
            src="data:image/png;base64,"
            alt="Liberty Mutual Logo"
            className="logo"
          />
          <img
            src="https://images.contentstack.io/v3/assets/blt62d40591b3650da3/blt483e097d64d66a25/66476d224ac76ee67740f2d5/logo-progressive.svg"
            alt="Progressive Logo"
            className="logo"
          />
          <span>+25 more</span>
        </div>
      </div>

      {/* Footer */}
      <footer className="footer">
        <div className="footer-columns">
          <div>
            <a href="#">Privacy Center</a> | <a href="#">Terms of Use</a> |{" "}
            <a href="#">Your Privacy Rights</a> | <a href="#">Contact Us</a>
          </div>
        </div>
        <>
          OfficialCarInsurance.com is a top savings referral service which
          enables consumers to quickly and easily request multiple competitive
          insurance quotes from optimally selected local insurance agents and
          companies using our proprietary consumer alignment technology. Our
          site does not provide quotes directly to consumers. We do not provide
          insurance and we do not represent any specific insurance provider.
          Please note that lowest listed rates and potential savings may not be
          representative or available from all companies.
          OfficialCarInsurance.com matches users to advertisers and insurance
          agents only after we've received certain information from you, and
          your actual rates and savings will vary based on your location,
          coverage limits, deductibles, driving records, type of vehicle,
          affiliations, and many other variables. The rates included in our
          advertising reflect the lowest monthly premium when paid semi-annually
          for a 2010 Kia Optima 4 Door Sedan driven for pleasure with less than
          3000 miles per year for a male, 41 or older driver with an
          above-average driving record. Safe driver, association and alumni
          membership, and other discounts may have been applied. The logos
          presented above represent carriers we work with, however coverage may
          not be available in all states. Those carriers can be reached at: The
          Allstate Corporation, 3100 Sanders Road Northbrook, IL 60062; The
          General Automobile Insurance Services Inc., 2636 Elm Hill Pike, Suite
          510, Nashville, Tennessee 37214; Liberty Mutual Insurance Company, 175
          Berkeley Street Boston, Massachusetts 02116; Progressive Corporation,
          6300 Wilson Mills Rd., Mayfield Village, OH 44143.
        </>
        <p>© 2024 OfficialCarInsurance.com. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default ZipCodePage2;
